(global["webpackJsonp"]=global["webpackJsonp"]||[]).push([["pages/login/agreement/agreement"],{"0b13":function(n,t,p){"use strict";(function(n){var p;Object.defineProperty(t,"__esModule",{value:!0}),t.default=void 0;getApp();var e,o={data:function(){return{content:'<div class="">\n\t<h2>用户协议</h2>\n\t<h3>一、特别提示</h3>\n\t<p>在此特别提醒您（用户）在注册成为优你所想用户之前，请认真阅读本《优你所想用户服务协议》（以下简称“协议”），确保您充分理解本协议中各条款。请您审慎阅读并选择接受或不接受本协议。您同意并点击确认本协议条款且完成注册程序后，才能成为优你所想的正式注册用户，并享受优你所想的各类服务。您的注册、登录、使用等行为将视为对本协议的接受，并同意接受本协议各项条款的约束。若您不同意本协议，或对本协议中的条款存在任何疑问，请您立即停止优你所想用户注册程序，并可以选择不使用本APP服务。</p>\n\t<p>本协议约定优你所想与用户之间关于“优你所想”服务（以下简称“服务”）的权利义务。“用户”是指注册、登录、使用本服务的个人、单位。本协议可由优你所想随时更新，更新后的协议条款一旦公布即代替原来的协议条款，恕不再另行通知，用户可在本APP中查阅最新版协议条款。在修改协议条款后，如果用户不接受修改后的条款，请立即停止使用优你所想提供的服务，用户继续使用优你所想提供的服务将被视为接受修改后的协议。</p>\n\t<h3>二、账号注册</h3>\n\t<p>1、用户在使用本服务时，如需备份本地遥控数据至云端，需要先注册一个“优你所想”账号。“优你所想”账号应当使用微信号码或手机号码绑定注册，请用户使用尚未与“优你所想”账号绑定的微信号码或手机号码，以及未被优你所想根据本协议封禁的微信号码或手机号码注册“优你所想”账号。优你所想可以根据用户需求或产品需要对账号注册和绑定的方式进行变更，而无须事先通知用户。</p>\n\t<p>2、如果注册申请者有被优你所想封禁的先例或涉嫌虚假注册及滥用他人名义注册，及其他不能得到许可的理由，优你所想将拒绝其注册申请。</p>\n\t<p>3、鉴于“优你所想”账号的绑定注册方式,您同意优你所想在注册时将允许您的手机号码及手机设备识别码等信息用于注册。</p>\n\t<p>4、在用户注册及使用本服务时,优你所想需要搜集能识别用户身份的个人信息以便优你所想可以在必要时联系用户,或为用户提供更好的使用体验。优你所想搜集的信息包括但不限于用户的姓名、地址;优你所想同意对这些信息的使用将受限于第三条用户个人隐私信息保护的约束。</p>\n\t<h3>三、账户安全</h3>\n\t<p>1、用户一旦注册成功,成为优你所想的注册用户,将得到一个用户名和密码,并有权利使用自己的用户名及密码随时进行登陆操作。</p>\n\t<p>2、用户对用户名和密码的安全负全部责任,同时对以其用户名进行的所有活动和事件负全责。</p>\n\t<p>3、用户不得以任何形式擅自转让或授权他人使用自己的优你所想用户名。</p>\n\t<p>4、用户对密码加以妥善保管,切勿将密码告知他人,因密码保管不善而造成的所有损失由用户自行承担。</p>\n\t<p>5、如果用户泄漏了密码,有可能导致不利的法律后果,因此不管任何原因导致用户的密码安全受到威胁,应该立即和优你所想客服人员取得联系,否则后果自负。</p>\n\t<h3>四、用户声明与保证</h3>\n\t<p>1、用户承诺其为具有完全民事行为能力的民事主体,且具有达成交易履行其义务的能力。</p>\n\t<p>2、用户有义务在注册时提供自己的真实资料,并保证诸如手机号码、姓名、所在地区等内容的有效性及安全性,保证优你所想工作人员可以通过上述联系方式与用户取得联系。同时,用户也有义务在相关资料实际变更时及时更新有关注册资料。</p>\n\t<p>3、用户通过使用优你所想的过程中所制作、上载、复制、发布、传播的任何內容,包括但不限于账号头像、名称、用户说明等注册信息及认证资料,或文字、语音、图片、视频、图文等发送、回复和相关链接页面,以及其他使用账号或本服务所产生的内容,不得违反国家相关法律制度,包含但不限于如下原则:</p>\n\t<p>(1)违反宪法所确定的基本原则的；</p>\n\t<p>(2)危害国家安全,泄露国家秘密,颠覆国家政权,破坏国家统一的；</p>\n\t<p>(3)损害国家荣誉和利益的；</p>\n\t<p>(4)煽动民族仇恨、民族歧视,破坏民族团结的；</p>\n\t<p>(5)破坏国家宗教政策,宣扬邪教和封建迷信的；</p>\n\t<p>(6)散布谣言,扰乱社公秩序,破坏社会稳定的；</p>\n\t<p>(7)散布淫秽、色情、赌博、暴力、凶杀、恐怖或者教唆犯罪的；</p>\n\t<p>(8)侮辱或者诽谤他人,侵害他人合法权益的；</p>\n\t<p>(9)含有法律、行政法规禁止的其他内容的。</p>\n\t<p>4、用户不得利用“优你所想”账号或本服务制作、上载、复制、发布、传播干扰“优你所想”的正常运营,以及侵犯其他用户或第三方合法权益的内容：</p>\n\t<p>(1)含有任何性或性暗示的；</p>\n\t<p>(2)含有辱骂、恐吓、威胁内容的；</p>\n\t<p>(3)含有骚扰、垃圾广告、恶意信息、诱骗信息的；</p>\n\t<p>(4)涉及他人隐私、个人信息或资料的；</p>\n\t<p>(5)侵害他人名誉权、肖像权、知识产权、商业秘密等合法权利的；</p>\n\t<p>(6)含有其他干扰本服务正常运营和侵犯其他用户或第三方合法权益内容的信息。</p>\n\t<h3>五、服务内容</h3>\n\t<p>1、优你所想是由深圳市龙岗区优你所想电子商务商行提供技术支持,用户通过优你所想以实现相关的软件使用。</p>\n\t<p>2、优你所想有权随时审核或删除用户发布/传播的涉嫌违法或违反社会主义精神文明,或者被优你所想认为不妥当的内容(包括但不限于文字、语音、图片、视频图文等)。</p>\n\t<p>3、所有发给用户的通告及其他消息都可通过APP或者用户所提供的联系方式发送。</p>\n\t<h4>六、服务的终止</h4>\n\t<p>1、在下列情况下,优你所想有权终止向用户提供服务；</p>\n\t<p>（1）在用户违反本服务协议相关规定时，优你所想有权终止向该用户提供服务；如该用户再一次直接或间接或以他人名义注册为用户的，一经发现，优你所想有权直接单方面终止向该用户提供服务；</p>\n\t<p>（2）如优你所想通过用户提供的信息与用户联系时，发现用户在注册时填写的联系方式已不存在或无法接通，优你所想以其它联系方式通知用户更改，而用户在三个工作日内仍未能提供新的联系方式，优你所想有权终止向该用户提供服务；</p>\n\t<p>（3）用户不得通过程序或人工方式进行刷量或作弊，若发现用户有作弊行为，优你所想将立即终止服务，并有权扣留账户内金额；</p>\n\t<p>（4）一旦优你所想发现用户提供的数据或信息中含有虚假内容，优你所想有权随时终止向该用户提供服务；</p>\n\t<p>（5）本服务条款终止或更新时，用户明示不愿接受新的服务条款；</p>\n\t<p>（6）以及其他优你所想认为需要终止服务的情况。</p>\n\t<p>2、服务终止后，优你所想没有义务为用户保留原账号中或与之相关的任何信息，或转发任何未曾阋读或发送的信息给用户或第三方。</p>\n\t<p>3、用户理解并同意，即便在本协议终止及用户的服务被终止后，优你所想仍有权：</p>\n\t<p>（1）继续续保存您的用户信息；</p>\n\t<p>（2）继续向用户主张在其使用APP服务期间因违反法律法规、本协议及平台规则而应承担的责任。</p>\n\t<p>（3）有权在用户长期不登陆后(比如超过6个月)删除用户账号信息。</p>\n\t<h3>七、服务的变更、中断</h3>\n\t<p>1、鉴于网络服务的特殊性，用户需同意优你所想会变更、中断部分或全部的网络服务，并删除（不再保存）用户在使用过程中提交的任何资料，而无需通知用户，也无需对任何用户或任何第三方承担任何责任。</p>\n\t<p>2、优你所想需要定期或不定期地对提供网络服务的平台进行检测或者更新，如因此类情况而造成网络服务在合理时间内的中断，优你所想无需为此承担任何责任。</p>\n\t<h3>八、服务条款修改</h3>\n\t<p>1、优你所想有权随时修改本服务条款的任何内容，一旦本服务条款的任何内容发生变动，优你所想将会通过适当方式向用户提示修改内容。</p>\n\t<p>2、如果不同意优你所想对本服务条款所做的修改，用户有权停止使用网络服务。</p>\n\t<p>3、如果用户继续使用网络服务，则视为用户接受优你所想对本服务条款所做的修改。</p>\n\t<h3>九、免责与赔偿声明</h3>\n\t<p>1、若优你所想已经明示其服务提供方式发生变更并提醒用户应当注意事项，用户未按要求操作所产生的一切后果由用户自行承担。</p>\n\t<p>2、用户明确同意其使用优你所想所存在的风险将完全由其自己承担，因其使用优你所想而产生的一切后果也由其自己承担。</p>\n\t<p>3、用户同意保障和维护优你所想及其他用户的利益，由于用户在使用优你所想有违法、不真实、不正当、侵犯第三方合法权益的行为，或用户违反本协议项下的任何条款而给优你所想及任何其他第三方造成损失，用户同意承担由此造成的损害赔偿责任。</p>\n\t<h3>十、隐私声明</h3>\n\t<p>1、适用范围：</p>\n\t<p>（1）在用户注册优你所想账户时，根据要求提供的个人注册信息；</p>\n\t<p>（2）在用户使用优你所想，或访问其相关网页时，优你所想自动接收并记录的用户浏览器上的服务器数值，包括但不限于IP地址等数据及用户要求取用的网页记录。</p>\n\t<p>2、信息使用：</p>\n\t<p>（1）优你所想不会向任何人出售或出借用户的个人信息，除非事先得到用户的许可；</p>\n\t<p>（2）优你所想亦不允许任何第三方以任何手段收集、编辑、出售或者无偿传播用户的个人信息。任何用户如从事上述活动，一经发现，优你所想有权立即终止与该用户的服务协议，查封其账号；</p>\n\t<p>（3）为达到服务用户的目的，优你所想可能通过使用用户的个人信息，向用户提供服务，包括但不限于向用户发出产品和服务信息，或者与优你所想合作伙伴共享信息以便他们向用户发送有关其产品和服务的信息。</p>\n\t<p>3、信息披露：用户的个人信息将在下述情況下部分或全部被披露：</p>\n\t<p>（1）经用用户同意，向第三方披露；</p>\n\t<p>（2）根据法律的有关规定，或者行政或司法机构的要求，向第三方或者行政、司法机构披露；</p>\n\t<p>（3）如果用户出现违反中国有关法律或者网站政策的情况，需要向第三方披露；</p>\n\t<p>（4）为提供用户所要求的产品和服务，而必须和第三方分享用户的个人信息；</p>\n\t<p>（5）其它优你所想根据法律或者网站政策认为合适的披露。</p>\n\t<h3>十一、其他</h3>\n\t<p>1、优你所想郑重提醒用户注意本协议中免除优你所想来责任和和限制用户权利的条款，请用户仔细阅读，自主考虑风险。未成年人应在法定监护人的陪同下阅读本协议。</p>\n\t<p>2、本协议的效力、解释及纠纷的解决，适用于中华人民共和国法律。若用户和优你所想之间发生任何纠纷或争议，首先应友好协解决，协商不成的，用户同意将纠纷或争议提交优你所想住所地有管辖权的人民法院管辖。</p>\n\t<p>3、本协议的任何条款无论因何种原因无效或不具可执行性，其余条款仍有效，对双方具有约束力。</p>\n\t<p>4、本协议最终解释权归优你所想有限公司所有，并且保留一切解释和修改的权力。</p>\n\t<p>5、本协议自2014年1月1日起适用。</p>\n\t<h2 style="margin-left:auto;margin-right:auto;width:200px">本应用隐私权政策</h2>\n\t<p>本应用尊重并保护所有使用服务用户的个人隐私权。为了给您提供更准确、更有个性化的服务，本应用会按照本隐私权政策的规定使用和披露您的个人信息。但本应用将以高度的勤勉、审慎义务对待这些信息。除本隐私权政策另有规定外，在未征得您事先许可的情况下，本应用不会将这些信息对外披露或向第三方提供。本应用会不时更新本隐私权政策。您在同意本应用服务使用协议之时，即视为您已经同意本隐私权政策全部内容。本隐私权政策属于本应用服务使用协议不可分割的一部分。</p>\n\t<h4>1.适用范围</h4>\n\t<p>a) 在您注册本应用帐号时，您根据本应用要求提供的个人注册信息；</p>\n\t<p>b) 在您使用本应用时， 本应用自动接收并记录的您手机上的信息，包括但不限于您的设备号、当前位置、IP地址、操作系统版本、使用的语言、访问日期和时间、软硬件特征信息及您的需求数据；</p>\n\t<p>c) 本应用为恬家(上海)信息科技有限公司官方应用，公司通过合法途径取得的用户个人数据以及智能设备相关数据。</p>\n\t<h4>您了解并同意，以下信息不适用本隐私权政策：</h4>\n\t<p>a)您在使用本应用提供的搜索服务时输入的关键字信息；</p>\n\t<p>b)本应用收集到的您在本应用发布的有关信息数据，包括但不限于参与活动、成交信息及评价详情；</p>\n\t<p>c)违反法律规定或违反本应用规则行为及本应用已对您采取的措施。</p>\n\t<h4>2.信息使用</h4>\n\t<p>a)本应用不会向任何无关第三方提供、出售、出租、分享或交易您的个人信息，除非事先得到您的许可，或该第三方和本应用单独或共同为您提供服务，且在该服务结束后，其将被禁止访问包括其以前能够访问的所有这些资料。</p>\n\t<p>b)本应用亦不允许任何第三方以任何手段收集、编辑、出售或者无偿传播您的个人信息。任何本应用用户如从事上述活动，一经发现，本应用有权立即终止与该用户的服务协议。</p>\n\t<p>c)为服务用户的目的，本应用可能通过使用您的个人信息，向您提供您感兴趣的信息，包括但不限于向您发出产品和服务信息，或者与本应用合作伙伴共享信息以便他们向您发送有关其产品和服务的信息（后者需要您的事先同意）。</p>\n\t<h4>3.信息披露</h4>\n\t<p>在如下情况下，本应用将依据您的个人意愿或法律的规定全部或部分的披露您的个人信息：</p>\n\t<p>a)经您事先同意，向第三方披露；</p>\n\t<p>b)为提供您所要求的产品和服务，而必须和第三方分享您的个人信息；</p>\n\t<p>c)根据法律的有关规定，或者行政或司法机构的要求，向第三方或者行政、司法机构披露；</p>\n\t<p>d)如您出现违反中国有关法律、法规或者本应用服务协议或相关规则的情况，需要向第三方披露；</p>\n\t<p>e)如您是适格的知识产权投诉人并已提起投诉，应被投诉人要求，向被投诉人披露，以便双方处理可能的权利纠纷；</p>\n\t<p>f)其它本应用根据法律、法规或者网站政策认为合适的披露。</p>\n\t<h4>4.信息存储和交换</h4>\n\t<p>本应用收集的有关您的信息和资料将保存在本应用及（或）其关联公司的服务器上，这些信息和资料可能传送至您所在国家、地区或本应用收集信息和资料所在地的境外并在境外被访问、存储和展示。</p>\n\t<h4>5.读写存储与获取地理位置的使用</h4>\n\t<p>a)在您未拒绝接受本应用能够获得本机地理位置、读写存储的情况下，本应用会在您的手机上设定或取用当前地理位置或读写本应用范围内的本地存储，以便您能登录或使用依赖于缓存的本应用服务或功能。</p>\n\t<p>b)您有权选择接受或拒绝接受本应用获取本机地理位置。您可以通过系统授权设置的方式设置本应用权利。但如果您选择拒绝接受获取本机地理位置，则您可能无法使用涉及定位、测距的本应用服务。</p>\n\t<p>c)通过本应用所设缓存、当前位置所取得的有关信息，将适用本政策。</p>\n\t<h4>6.相机、录音、读取手机状态权限的使用</h4>\n\t<p>a)在您未拒绝接受本应用能够获得相机、录音、读取手机状态权限的情况下，本应用会在您的手机上打开并使用相机、录音、读取手机状态权限功能，以便您能登录或使用依赖于此类权限的本应用服务或功能，如扫描二维码、语音遥控等。</p>\n\t<p>b)您有权选择接受或拒绝接受本应用获取相机、录音、读取手机状态权限。您可以通过系统授权设置的方式设置本应用权利。但如果您选择拒绝本应用获取相机、录音、读取手机状态权限，则您可能无法使用涉及扫描二维码、语音遥控等的本应用服务。</p>\n\t<p>c)通过本应用开启相机、录音、读取手机状态所取得的有关信息，将适用本政策。</p>\n\t<h4>7. 信息安全</h4>\n\t<p>a)本应用帐号均有安全保护功能，请妥善保管您的账号信息。本应用将通过对账号信息进行加密等安全措施确保您的信息不丢失，不被滥用和变造。尽管有前述安全措施，但同时也请您注意在信息网络上不存在“完善的安全措施”。</p>\n\t<p>b)在使用本应用网络服务进行网上交易时，您不可避免的要向交易对方披露自己的个人信息，如联络方式或者手机号码。请您妥善保护自己的个人信息，仅在必要的情形下向他人提供。如您发现自己的个人信息泄密，尤其是本应用用户名及密码发生泄露，请您立即联络本应用客服，以便本应用采取相应措施。</p>\n</div>'}},onPageScroll:function(n){},onLoad:function(n){p=this,p.options=n,e=p.vk},onReady:function(){},onShow:function(){n.setNavigationBarTitle({title:p.$t("mine.agreement")})},onHide:function(){},onPullDownRefresh:function(){},onReachBottom:function(){},onResize:function(){},onShareAppMessage:function(n){},created:function(){},methods:{init:function(){var n=arguments.length>0&&void 0!==arguments[0]?arguments[0]:{};console.log("init: ",n)},pageTo:function(n){e.navigateTo(n)}},filters:{},computed:{}};t.default=o}).call(this,p("543d")["default"])},3546:function(n,t,p){"use strict";p.r(t);var e=p("907a"),o=p("7038");for(var a in o)"default"!==a&&function(n){p.d(t,n,(function(){return o[n]}))}(a);var u,i=p("f0c5"),c=Object(i["a"])(o["default"],e["b"],e["c"],!1,null,null,null,!1,e["a"],u);t["default"]=c.exports},7038:function(n,t,p){"use strict";p.r(t);var e=p("0b13"),o=p.n(e);for(var a in e)"default"!==a&&function(n){p.d(t,n,(function(){return e[n]}))}(a);t["default"]=o.a},"907a":function(n,t,p){"use strict";p.d(t,"b",(function(){return o})),p.d(t,"c",(function(){return a})),p.d(t,"a",(function(){return e}));var e={uParse:function(){return Promise.all([p.e("common/vendor"),p.e("node-modules/uview-ui/components/u-parse/u-parse")]).then(p.bind(null,"03f5"))}},o=function(){var n=this,t=n.$createElement;n._self._c},a=[]},f2e3:function(n,t,p){"use strict";(function(n){p("3d10"),p("921b");e(p("66fd"));var t=e(p("3546"));function e(n){return n&&n.__esModule?n:{default:n}}n(t.default)}).call(this,p("543d")["createPage"])}},[["f2e3","common/runtime","common/vendor"]]]);